size_t G2U_Message::Unpack(const uint8_t* buff, const size_t len)
{
	const SafeMessageBuffer buffer(const_cast<uint8_t*>(buff), len, false);
	return Unpack(buffer);
}

size_t G2U_Message::Unpack(const SafeMessageBuffer& buffer)
{
	Type newType {Type::INVALID};
	const Type oldType {GetType()};
	buffer.Read(newType);
	if (newType != oldType) {
		ClearCurrent();
	}
	switch(newType) {
	case Type::Ping:
		if (newType != oldType) {
			new(&(this->_Ping)) Anki::Cozmo::G2U_Ping(buffer);
		}
		else {
			this->_Ping.Unpack(buffer);
		}
		break;
	case Type::RobotAvailable:
		if (newType != oldType) {
			new(&(this->_RobotAvailable)) Anki::Cozmo::G2U_RobotAvailable(buffer);
		}
		else {
			this->_RobotAvailable.Unpack(buffer);
		}
		break;
	case Type::UiDeviceAvailable:
		if (newType != oldType) {
			new(&(this->_UiDeviceAvailable)) Anki::Cozmo::G2U_UiDeviceAvailable(buffer);
		}
		else {
			this->_UiDeviceAvailable.Unpack(buffer);
		}
		break;
	case Type::RobotConnected:
		if (newType != oldType) {
			new(&(this->_RobotConnected)) Anki::Cozmo::G2U_RobotConnected(buffer);
		}
		else {
			this->_RobotConnected.Unpack(buffer);
		}
		break;
	case Type::RobotDisconnected:
		if (newType != oldType) {
			new(&(this->_RobotDisconnected)) Anki::Cozmo::G2U_RobotDisconnected(buffer);
		}
		else {
			this->_RobotDisconnected.Unpack(buffer);
		}
		break;
	case Type::UiDeviceConnected:
		if (newType != oldType) {
			new(&(this->_UiDeviceConnected)) Anki::Cozmo::G2U_UiDeviceConnected(buffer);
		}
		else {
			this->_UiDeviceConnected.Unpack(buffer);
		}
		break;
	case Type::RobotState:
		if (newType != oldType) {
			new(&(this->_RobotState)) Anki::Cozmo::G2U_RobotState(buffer);
		}
		else {
			this->_RobotState.Unpack(buffer);
		}
		break;
	case Type::ImageChunk:
		if (newType != oldType) {
			new(&(this->_ImageChunk)) Anki::Cozmo::G2U_ImageChunk(buffer);
		}
		else {
			this->_ImageChunk.Unpack(buffer);
		}
		break;
	case Type::RobotObservedObject:
		if (newType != oldType) {
			new(&(this->_RobotObservedObject)) Anki::Cozmo::G2U_RobotObservedObject(buffer);
		}
		else {
			this->_RobotObservedObject.Unpack(buffer);
		}
		break;
	case Type::RobotObservedNothing:
		if (newType != oldType) {
			new(&(this->_RobotObservedNothing)) Anki::Cozmo::G2U_RobotObservedNothing(buffer);
		}
		else {
			this->_RobotObservedNothing.Unpack(buffer);
		}
		break;
	case Type::RobotDeletedObject:
		if (newType != oldType) {
			new(&(this->_RobotDeletedObject)) Anki::Cozmo::G2U_RobotDeletedObject(buffer);
		}
		else {
			this->_RobotDeletedObject.Unpack(buffer);
		}
		break;
	case Type::DeviceDetectedVisionMarker:
		if (newType != oldType) {
			new(&(this->_DeviceDetectedVisionMarker)) Anki::Cozmo::G2U_DeviceDetectedVisionMarker(buffer);
		}
		else {
			this->_DeviceDetectedVisionMarker.Unpack(buffer);
		}
		break;
	case Type::RobotCompletedAction:
		if (newType != oldType) {
			new(&(this->_RobotCompletedAction)) Anki::Cozmo::G2U_RobotCompletedAction(buffer);
		}
		else {
			this->_RobotCompletedAction.Unpack(buffer);
		}
		break;
	case Type::PlaySound:
		if (newType != oldType) {
			new(&(this->_PlaySound)) Anki::Cozmo::G2U_PlaySound(buffer);
		}
		else {
			this->_PlaySound.Unpack(buffer);
		}
		break;
	case Type::StopSound:
		if (newType != oldType) {
			new(&(this->_StopSound)) Anki::Cozmo::G2U_StopSound(buffer);
		}
		else {
			this->_StopSound.Unpack(buffer);
		}
		break;
	default:
		break;
	}
	_type = newType;
	return buffer.GetBytesRead();
}

size_t G2U_Message::Pack(uint8_t* buff, size_t len) const
{
	SafeMessageBuffer buffer(buff, len, false);
	return Pack(buffer);
}

size_t G2U_Message::Pack(SafeMessageBuffer& buffer) const
{
	buffer.Write(_type);
	switch(GetType()) {
	case Type::Ping:
		this->_Ping.Pack(buffer);
		break;
	case Type::RobotAvailable:
		this->_RobotAvailable.Pack(buffer);
		break;
	case Type::UiDeviceAvailable:
		this->_UiDeviceAvailable.Pack(buffer);
		break;
	case Type::RobotConnected:
		this->_RobotConnected.Pack(buffer);
		break;
	case Type::RobotDisconnected:
		this->_RobotDisconnected.Pack(buffer);
		break;
	case Type::UiDeviceConnected:
		this->_UiDeviceConnected.Pack(buffer);
		break;
	case Type::RobotState:
		this->_RobotState.Pack(buffer);
		break;
	case Type::ImageChunk:
		this->_ImageChunk.Pack(buffer);
		break;
	case Type::RobotObservedObject:
		this->_RobotObservedObject.Pack(buffer);
		break;
	case Type::RobotObservedNothing:
		this->_RobotObservedNothing.Pack(buffer);
		break;
	case Type::RobotDeletedObject:
		this->_RobotDeletedObject.Pack(buffer);
		break;
	case Type::DeviceDetectedVisionMarker:
		this->_DeviceDetectedVisionMarker.Pack(buffer);
		break;
	case Type::RobotCompletedAction:
		this->_RobotCompletedAction.Pack(buffer);
		break;
	case Type::PlaySound:
		this->_PlaySound.Pack(buffer);
		break;
	case Type::StopSound:
		this->_StopSound.Pack(buffer);
		break;
	default:
		break;
	}
	const size_t bytesWritten {buffer.GetBytesWritten()};
	return bytesWritten;
}

